import React from 'react';
import './Contact.css';

export default function Contact() {
  return (
    <div className='Contact-container'>
        <div className='contact-heading'>
            <h1>Contact Me </h1>
            <p>Lets Keep In Touch</p>
        </div>
    </div>
  )
}
